y Id","vintage":null,"source":null,"units":null,"decimals":null},"StdGeographyLevel":{"type":"string","alias":"Standard geography level","vintage":null,"source":null,"units":null,"decimals":null},"ATRISKTOTPOP_CY":{"type":"number","alias":"2025 Total Population","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of the Total Population in the geographic area. Total Population includes population living in households, on active duty in the Armed Forces, and living in group quarters such as correctional facilities, skilled nursing facilities, juvenile facilities, college dorms, and military barracks. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"ATRISKAVGHHSZ_CY":{"type":"number","alias":"2025 Average Household Size","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of Average Household Size in the geographic area. The Average Household Size is calculated by dividing the number of persons living in households by the total number of households in the current year. Households include all the people who occupy a housing unit (such as a house or apartment) as their usual residence.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"ATRISKTOTHH_CY":{"type":"number","alias":"2025 Total Households","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of the Total Households in the geographic area. A household includes all people who occupy one housing unit (such as a house or apartment) as their usual residence. A household may include related family members, unrelated people, a person living alone, or a group of unrelated people sharing a housing unit, such as partners or roommates. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSPOPGRWCYFY":{"type":"number","alias":"2025-2030 Growth Rate: Population","vintage":"2030","source":"Esri","units":null,"decimals":null,"definition":"The Esri 2025-2030 Population Compound Annual Growth Rate (CAGR) is an annualized measure describing the direction (either positive or negative) and magnitude of change in the total number of persons between the years 2025 and 2030. Annualized means that the resultant value reflects a rate of change over a twelve-month time period. This permits analysis of multiple growth rates between values measured at differing points in time using a common time period of twelve months; the annualized growth rate is repeated, or compounded, each year. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocabulary/cagr'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSHHGRWCYFY":{"type":"number","alias":"2025-2030 Growth Rate: Households","vintage":"2030","source":"Esri","units":null,"decimals":null,"definition":"The Esri 2025-2030 Household Compound Annual Growth Rate (CAGR) is an annualized measure describing the direction (either positive or negative) and magnitude of change in the total number of households between the years 2025 and 2030. Annualized means that the resultant value reflects a rate of change over a twelve-month time period. This permits analysis of multiple growth rates between values measured at differing points in time using a common time period of twelve months; the annualized growth rate is repeated, or compounded, each year. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocabulary/cagr'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSFAMGRWCYFY":{"type":"number","alias":"2025-2030 Growth Rate: Family HHs","vintage":"2030","source":"Esri","units":null,"decimals":null,"definition":"The Esri 2025-2030 Family Households Compound Annual Growth Rate (CAGR) is an annualized measure describing the direction (either positive or negative) and magnitude of change in family households between the years 2025 and 2030. A family consists of two or more people residing together that are related by birth, marriage, or adoption. Annualized means that the resultant value reflects a rate of change over a twelve-month time period. This permits analysis of multiple growth rates between values measured at differing points in time using a common time period of twelve months; the annualized growth rate is repeated, or compounded, each year. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocabulary/cagr'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"_5YEARINCREMENTSMEDAGE_CY":{"type":"number","alias":"2025 Median Age","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of the Median Age of the population in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"HEALTHMEDHINC_CY":{"type":"number","alias":"2025 Median Household Income","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of Median Household Income in the geographic area. Median Household Income is the amount that divides household income (annual income for all household earners age 15+) into two equal groups in a geographic area; half of the population will have income higher than the median and half will have lower income. If the median falls in the upper income interval of $500,000+, it is represented by the value of $500,001. Esri uses the U.S. Census definition of income; reference <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>Esri Essential Vocabulary</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSMEDVAL_CY":{"type":"number","alias":"2025 Median Home Value","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of the Median Home Value in the geographic area. Median Home Value divides home values into two equal groups; half of the homes will have a value higher than the median, and half lower. If the median is $2,000,000+, it is represented by a value of $2,000,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"HOUSINGUNITTOTALSHAI_CY":{"type":"number","alias":"2025 Housing Affordability Index","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 Housing Affordability Index (HAI) measures the ability of a typical resident to purchase a home in the geographic area. The HAI has a base of 100, representing where the median income is sufficient to qualify for a loan on a median-valued home and not be cost-burdened (cost-burdened=greater than 30% of income spent on housing). HAI values > 100 indicate increasing affordability; HAI values < 100 indicate areas where homes are less affordable and median income might be insufficient to purchase a median-valued home.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"ELECTRONICSINTERNETMP19001A_B_P":{"type":"number","alias":"2025 Have Internet Access at Home: Percent","vintage":"2025","source":"Esri-MRI-Simmons","units":null,"decimals":null,"definition":"Esri 2025 estimate of the expected number of adults and Market Potential Index (MPI) for <em>2025 Have Internet Access at Home</em> in the geographic area. Esris Market Potential data provides information about the likely demand for specific products or services, as well as expected consumer attitudes and behaviors, in an area. The MPI compares local consumer demand, attitudes, and behaviors to U.S. levels. The MPI value for the U.S. is 100. If, for example, the MPI value for a geographic area is 150 this implies that consumer demand in the geographic area is likely to be 50% more than the U.S. average. Sources: Esri and MRI-Simmons. See <a target='_blank' href='https://links.esri.com/demographics/market-potential'>Market Potential data</a> for more information."},"ELECTRONICSINTERNETMP19003A_B":{"type":"number","alias":"2025 Cable Modem Internet Connection at Home","vintage":"2025","source":"Esri-MRI-Simmons","units":null,"decimals":null,"definition":"Esri 2025 estimate of the expected number of adults and Market Potential Index (MPI) for <em>2025 Cable Modem Connection to Internet at Home</em> in the geographic area. Esris Market Potential data provides information about the likely demand for specific products or services, as well as expected consumer attitudes and behaviors, in an area. The MPI compares local consumer demand, attitudes, and behaviors to U.S. levels. The MPI value for the U.S. is 100. If, for example, the MPI value for a geographic area is 150 t source":"Esri","definition":"The Esri 2025-2030 Population Compound Annual Growth Rate (CAGR) is an annualized measure describing the direction (either positive or negative) and magnitude of change in the total number of persons between the years 2025 and 2030. Annualized means that the resultant value reflects a rate of change over a twelve-month time period. This permits analysis of multiple growth rates between values measured at differing points in time using a common time period of twelve months; the annualized growth rate is repeated, or compounded, each year. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocabulary/cagr'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSHHGRWCYFY":{"id":"HHGRWCYFY","fullName":"KeyUSFacts.HHGRWCYFY","alias":"2025-2030 Growth Rate: Households","fieldName":"KEYUSFACTSHHGRWCYFY","precision":1,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSHHGRWCYFY","type":"esriFieldTypeDouble","vintage":"2030","source":"Esri","definition":"The Esri 2025-2030 Household Compound Annual Growth Rate (CAGR) is an annualized measure describing the direction (either positive or negative) and magnitude of change in the total number of households between the years 2025 and 2030. Annualized means that the resultant value reflects a rate of change over a twelve-month time period. This permits analysis of multiple growth rates between values measured at differing points in time using a common time period of twelve months; the annualized growth rate is repeated, or compounded, each year. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocabulary/cagr'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSFAMGRWCYFY":{"id":"FAMGRWCYFY","fullName":"KeyUSFacts.FAMGRWCYFY","alias":"2025-2030 Growth Rate: Family HHs","fieldName":"KEYUSFACTSFAMGRWCYFY","precision":1,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSFAMGRWCYFY","type":"esriFieldTypeDouble","vintage":"2030","source":"Esri","definition":"The Esri 2025-2030 Family Households Compound Annual Growth Rate (CAGR) is an annualized measure describing the direction (either positive or negative) and magnitude of change in family households between the years 2025 and 2030. A family consists of two or more people residing together that are related by birth, marriage, or adoption. Annualized means that the resultant value reflects a rate of change over a twelve-month time period. This permits analysis of multiple growth rates between values measured at differing points in time using a common time period of twelve months; the annualized growth rate is repeated, or compounded, each year. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocabulary/cagr'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator._5YEARINCREMENTSMEDAGE_CY":{"id":"MEDAGE_CY","fullName":"5yearincrements.MEDAGE_CY","alias":"2025 Median Age","fieldName":"_5YEARINCREMENTSMEDAGE_CY","precision":1,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator._5YEARINCREMENTSMEDAGE_CY","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri","definition":"Esri 2025 estimate of the Median Age of the population in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.HEALTHMEDHINC_CY":{"id":"MEDHINC_CY","fullName":"Health.MEDHINC_CY","alias":"2025 Median Household Income","fieldName":"HEALTHMEDHINC_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HEALTHMEDHINC_CY","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri","definition":"Esri 2025 estimate of Median Household Income in the geographic area. Median Household Income is the amount that divides household income (annual income for all household earners age 15+) into two equal groups in a geographic area; half of the population will have income higher than the median and half will have lower income. If the median falls in the upper income interval of $500,000+, it is represented by the value of $500,001. Esri uses the U.S. Census definition of income; reference <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>Esri Essential Vocabulary</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSMEDVAL_CY":{"id":"MEDVAL_CY","fullName":"KeyUSFacts.MEDVAL_CY","alias":"2025 Median Home Value","fieldName":"KEYUSFACTSMEDVAL_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSMEDVAL_CY","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri","definition":"Esri 2025 estimate of the Median Home Value in the geographic area. Median Home Value divides home values into two equal groups; half of the homes will have a value higher than the median, and half lower. If the median is $2,000,000+, it is represented by a value of $2,000,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.HOUSINGUNITTOTALSHAI_CY":{"id":"HAI_CY","fullName":"housingunittotals.HAI_CY","alias":"2025 Housing Affordability Index","fieldName":"HOUSINGUNITTOTALSHAI_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSINGUNITTOTALSHAI_CY","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri","definition":"Esri 2025 Housing Affordability Index (HAI) measures the ability of a typical resident to purchase a home in the geographic area. The HAI has a base of 100, representing where the median income is sufficient to qualify for a loan on a median-valued home and not be cost-burdened (cost-burdened=greater than 30% of income spent on housing). HAI values > 100 indicate increasing affordability; HAI values < 100 indicate areas where homes are less affordable and median income might be insufficient to purchase a median-valued home.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.ELECTRONICSINTERNETMP19001A_B_P":{"id":"MP19001A_B_P","fullName":"ElectronicsInternet.MP19001A_B_P","alias":"2025 Have Internet Access at Home: Percent","fieldName":"ELECTRONICSINTERNETMP19001A_B_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.ELECTRONICSINTERNETMP19001A_B_P","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri-MRI-Simmons","definition":"Esri 2025 estimate of the expected number of adults and Market Potential Index (MPI) for <em>2025 Have Internet Access at Home</em> in the geographic area. Esris Market Potential data provides information about the likely demand for specific products or services, as well as expected consumer attitudes and behaviors, in an area. The MPI compares local consumer demand, attitudes, and behaviors to U.S. levels. The MPI value for the U.S. is 100. If, for example, the MPI value for a geographic area is 150 this implies that consumer demand in the geographic area is likely to be 50% more than the U.S. average. Sources: Esri and MRI-Simmons. See <a target='_blank' href='https://links.esri.com/demographics/market-potential'>Market Potential data</a> for more information."},"dataCollectionsCalculator.ELECTRONICSINTERNETMP19003A_B":{"id":"MP19003A_B","fullName":"ElectronicsInternet.MP19003A_B","alias":"2025 Cable Modem Internet Connection at Home","fieldName":"ELECTRONICSINTERNETMP19003A_B","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.ELECTRONICSINTERNETMP19003A_B","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri-MRI-Simmons","definition":"Esri 2025 estimate of the expected number of adults and Market Potential Index (MPI) for <em>2025 Cable Modem Connection to Internet at Home</em> in the geographic area. Esris Market Potential data provides information about the likely demand for specific products or services, as well as expected consumer attitudes and behaviors, in an area. The MPI compares local consumer demand, attitudes, and behaviors to U.S. levels. The MPI value for the U.S. is 100. If, for example, the MPI value for a geographic area is 150 this implies that consumer demand in the geographic area is likely to be 50% more than the U.S. average. Sources: Esri and MRI-Simmons. See <a target='_blank' href='https://links.esri.com/demographics/market-potential'>Market Potential data</a> for more information."},"dataCollectionsCalculator.ELECTRONICSINTERNETMP19004A_B":{"id":"MP19004A_B","fullName":"ElectronicsInternet.MP19004A_B","alias":"2025 DSL Internet Connection at Home","fie  Daytime Population includes workers (civilian, non-military employed at work, and armed forces personnel ages 16+) and residents (population age 0-15, unemployed adults, those not in the labor force, and employed civilians who are not working temporarily due to illness, vacation, etc.). See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.BUSINESSESS01_BUS":{"id":"S01_BUS","fullName":"businesses.S01_BUS","alias":"2025 Total Businesses (SIC)","fieldName":"BUSINESSESS01_BUS","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.BUSINESSESS01_BUS","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri-Data Axle","definition":"Esri 2025 estimate of the total number of businesses in SIC Code 01-99. Estimate based on business listings provided by Data Axle. See <a target='_blank' href='https://links.esri.com/demographics/business-summary'>Business Data</a> for more information."},"dataCollectionsCalculator.EMPLOYEESS01_EMP":{"id":"S01_EMP","fullName":"employees.S01_EMP","alias":"2025 Total Employees (SIC)","fieldName":"EMPLOYEESS01_EMP","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.EMPLOYEESS01_EMP","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri-Data Axle","definition":"Esri 2025 estimate of the total number of employees working for businesses in SIC Code 01-99. Estimate based on business listings provided by Data Axle. See <a target='_blank' href='https://links.esri.com/demographics/business-summary'>Business Data</a> for more information."},"dataCollectionsCalculator.DAYTIMEPOPULATIONDPOPWRK_CY_P":{"id":"DPOPWRK_CY_P","fullName":"DaytimePopulation.DPOPWRK_CY_P","alias":"2025 Daytime Pop: Workers: Percent","fieldName":"DAYTIMEPOPULATIONDPOPWRK_CY_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.DAYTIMEPOPULATIONDPOPWRK_CY_P","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri-Data Axle","definition":"Esri 2025 estimate of the Daytime Population who are Workers in the geographic area. Daytime Workers include population age 16+ who are civilian, non-military at work (commuters and non-commuters), and armed forces (on and off base). See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.DAYTIMEPOPULATIONDPOPRES_CY_P":{"id":"DPOPRES_CY_P","fullName":"DaytimePopulation.DPOPRES_CY_P","alias":"2025 Daytime Pop: Residents: Percent","fieldName":"DAYTIMEPOPULATIONDPOPRES_CY_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.DAYTIMEPOPULATIONDPOPRES_CY_P","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri-Data Axle","definition":"Esri 2025 estimate of the Daytime Population who are Residents in the geographic area. Daytime Residents include population age 0-15; unemployed adults; those not in the Labor Force such as retirees, homemakers, college students, residents of institutions and non-institutional group homes, detention centers and shelters; and employed civilians who are temporarily not working due to illness, vacation, bad weather, labor dispute, etc. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.INDUSTRYEMP_CY":{"id":"EMP_CY","fullName":"industry.EMP_CY","alias":"2025 Employed Civilian Pop 16+","fieldName":"INDUSTRYEMP_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.INDUSTRYEMP_CY","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri","definition":"Esri 2025 estimate of the Employed Civilian Population Age 16+ in the geographic area. Employed Civilian Population include those who are non-military employees or are self-employed, including those who work 15 hours or more for a family business (paid or unpaid) or those who are temporarily absent from work due to illness, vacation, or other personal reasons. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.INDUSTRYUNEMP_CY":{"id":"UNEMP_CY","fullName":"industry.UNEMP_CY","alias":"2025 Unemployed Population 16+","fieldName":"INDUSTRYUNEMP_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.INDUSTRYUNEMP_CY","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri","definition":"Esri 2025 estimate of the Unemployed Population Age 16+ in the geographic area. Unemployed Population include those who are not on active duty in the Armed Forces, neither currently working nor waiting to work a job they hold, and have actively sought employment during the past four weeks and are available to work if hired; includes temporarily laid off employees. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.ATRISKACSHHBPOV":{"id":"ACSHHBPOV","fullName":"AtRisk.ACSHHBPOV","alias":"2023 HHs: Inc Below Poverty Level (ACS 5-Yr)","fieldName":"ATRISKACSHHBPOV","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.ATRISKACSHHBPOV","type":"esriFieldTypeDouble","vintage":"2019-2023","source":"ACS","definition":"ACS five-year estimate of the number of Households with income Below the Poverty Level in the geographic area. Estimate and Margin of Error (MOE) from the U.S. Census American Community Survey (ACS) rolling sample 60-month survey; Esri Reliability measure designat
